import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login'; // Adjust if necessary
import Apply from './components/Apply';   // Adjust if necessary
import Review from './components/Review'; // Import the Review component

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/apply" element={<Apply />} />
        <Route path="/review" element={<Review />} /> {/* Add the Review route */}
      </Routes>
    </Router>
  );
}

export default App;
